import React from 'react';
import Slider from 'react-slick';
import './Projetos.css';

const Projetos = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
        autoplay: true,
        autoplaySpeed: 3000,
    };

    return (
        <section id="portfolio" className="portfolio">
            <h2 className="titulo-secao">Portfólio e Projetos</h2>
            <p>Veja alguns dos meus projetos:</p>
            <Slider {...settings} className="projetos-carousel">
                <div className="projeto-slide">
                    {/*<img src="projeto1.jpg" alt="Projeto para Cliente" />*/}
                    <div className="slide-caption">
                        <h3>Projeto para Cliente</h3>
                        <p>Sistema de gestão de academias desenvolvido com Node.js e React.</p>
                    </div>
                </div>
                <div className="projeto-slide">
                    {/*<img src="projeto2.jpg" alt="Projeto Acadêmico" />*/}
                    <div className="slide-caption">
                        <h3>Projeto Acadêmico</h3>
                        <p>Portal de notícias para estudos com Java e MySQL.</p>
                    </div>
                </div>
            </Slider>
        </section>
    );
};

export default Projetos;
